.header {
  &__container {
    position: fixed;
    display: flex;
    align-items: center;
    justify-content: center;
    top: 0px;
    left: 0px;
    width: 100vw;
    height: 7vh;
  }
  &__wrapper {
    background-color: transparent;
  }
  &__body {
    display: flex;
    min-height: 100px;
    align-items: center;
    justify-content: space-around;
  }
  &__logo {
    display: flex;
    align-items: center;
    text-align: center;
    justify-content: space-around;
    margin-left: 30px;
    @media screen and (max-width: 930px) {
      margin-left: 20px;
    }
  }
  &__burger {
    background-color: transparent;
    border: none;
    height: 50px;
    width: 50px;
    display: none;
    align-items: center;
    padding: 0;
    cursor: pointer;
    z-index: 20;

    @media screen and (max-width: 600px) {
      margin-right: 30px;
    }

    span {
      width: 100%;
      height: 2px;
      background-color: #faf6f2;
      position: relative;
      z-index: 20;

      &:before {
        content: "";
        position: absolute;
        height: 2px;
        width: 100%;
        background-color: #faf6f2;
        bottom: 10px;
        left: 0;
      }
      &:after {
        content: "";
        position: absolute;
        height: 2px;
        width: 100%;
        background-color: #faf6f2;
        top: 10px;
        left: 0;
      }
    }
  }
  &__menu {
    display: flex;
    align-items: center;
    width: 100%;
    justify-content: flex-end;
    margin-right: 20px;
  }
  &__list {
    display: flex;
    text-decoration: none;
    li {
      margin-left: 50px;
      @media screen and (max-width: 1030px) {
        margin-left: 30px;
      }
      @media screen and (max-width: 1030px) {
        margin-left: 20px;
      }
    }
  }
  &__link {
    text-decoration: none;
    font-size: 17px;
    font-weight: 700;
    line-height: 15px;
    letter-spacing: 0em;
    color: @white-text-color;
    white-space: nowrap;
    @media screen and (max-width: 1030px) {
      font-size: 12px;
      line-height: 14px;
    }
    &:hover {
      background-color: transparent;
      border-bottom: solid 3px #babbc5;
      padding-bottom: 40px;
    }
  }
  &__sidebar {
    display: none;
    width: 100%;
    position: absolute;
    height: 100vh;
    background-image: url(../images/bg-header.png);
    background-size: cover;
    top: 0;
    padding-left: 30px;
    &_active {
      display: flex;
    }
    &-burger {
      padding-top: 40px;
    }
    &-top {
      display: flex;
      padding: 70px 0 0 0;
    }
    &-list {
      a {
        font-size: 25px;
        font-weight: 700;
        line-height: 15px;
      }
      li {
        padding: 60px 0;
      }
      display: flex;
      flex-direction: column;
    }
  }
}
.header {
  position: relative;
}
@media screen and (max-width: 760px) {
  .header__menu {
    display: none;
  }
  .header__burger {
    display: flex;
  }
}
.header__divider {
  border-bottom: 1px solid #babbc5;
  display: block;
  margin: 0 auto;
  width: 80%;
  z-index: 11;
}

